import { Route, Routes } from "react-router-dom";
import PokeCardList from "./List/PokeCardList";

const PageNavigator = () => {
  return (
    <Routes>
      <Route path="/" element={<PokeCardList />} />
      <Route path="/" element={<App />} />
    </Routes>
  );
};

export default PageNavigator;
